import{_ as e,a as r}from"./chunks/rtk_here_plug_gps_to_6pin_connector.BSTnlEjh.js";import{_ as i,c as o,a8 as n,o as a}from"./chunks/framework.BDnHobkS.js";const m=JSON.parse('{"title":"HEX/ProfiCNC Here2 GPS (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"en/gps_compass/gps_hex_here2.md","filePath":"en/gps_compass/gps_hex_here2.md"}'),s={name:"en/gps_compass/gps_hex_here2.md"};function l(d,t,c,h,p,u){return a(),o("div",null,t[0]||(t[0]=[n('<h1 id="hex-proficnc-here2-gps-discontinued" tabindex="-1">HEX/ProfiCNC Here2 GPS (Discontinued) <a class="header-anchor" href="#hex-proficnc-here2-gps-discontinued" aria-label="Permalink to &quot;HEX/ProfiCNC Here2 GPS (Discontinued)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This has been superseded by the <a href="https://www.cubepilot.com/#/here/here3" target="_blank" rel="noreferrer">Cube Here 3</a></p></div><p>The <a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">Here2 GPS receiver</a> is an update to the Here GPS module from HEX.</p><p>Main features include:</p><ul><li>Concurrent reception of up to 3 GNSS (GPS, Galileo, GLOSNASS, BeiDou)</li><li>Industry Leading -167 dBm navigation sensitivity</li><li>Security and integrity protection</li><li>Supports all satellite augmentation systems</li><li>Advanced jamming and spoofing detection</li></ul><img src="'+e+'"><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">ProfiCNC</a> (Australia)</li><li><a href="http://www.proficnc.com/stores" target="_blank" rel="noreferrer">Other resellers</a></li></ul><h2 id="configuration" tabindex="-1">Configuration <a class="header-anchor" href="#configuration" aria-label="Permalink to &quot;Configuration&quot;">​</a></h2><p>Setup and use on PX4 is largely plug and play.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>If the GPS is <em>not detected</em> then <a href="https://docs.cubepilot.org/user-guides/here-2/updating-here-2-firmware" target="_blank" rel="noreferrer">update the Here2 firmware</a>.</li><li>If the GPS is detected but does not work, attempt the process outlined in <a href="https://docs.cubepilot.org/user-guides/here-2/here-2-can-mode-instruction" target="_blank" rel="noreferrer">allocating node uavcan ID</a>.</li></ul></div><h2 id="wiring-and-connections" tabindex="-1">Wiring and Connections <a class="header-anchor" href="#wiring-and-connections" aria-label="Permalink to &quot;Wiring and Connections&quot;">​</a></h2><p>The Here2 GPS comes with an 8 pin connector that can be inserted directly into the <a href="http://www.hex.aero/wp-content/uploads/2016/07/DRS_Pixhawk-2-17th-march-2016.pdf" target="_blank" rel="noreferrer">Pixhawk 2</a> GPS UART port.</p><p>The Pixhawk 3 Pro and Pixracer have a 6 pin GPS port connector. For these controllers you can modify the GPS cable (as shown below) to remove pin 6 and 7.</p><img src="'+r+'" width="500px"><p>Pin 6 and 7 are for the safety button - these can be attached as well if needed.</p><h3 id="pinout" tabindex="-1">Pinout <a class="header-anchor" href="#pinout" aria-label="Permalink to &quot;Pinout&quot;">​</a></h3><p>The Here2 GPS pinout is provided below. This can be used to help modify the connector for other autopilot boards.</p><table tabindex="0"><thead><tr><th>pin</th><th>Here2 GPS</th><th>pin</th><th>Pixhawk 3 Pro GPS</th></tr></thead><tbody><tr><td>1</td><td>VCC_5V</td><td>1</td><td>VCC</td></tr><tr><td>2</td><td>GPS_RX</td><td>2</td><td>GPS_TX</td></tr><tr><td>3</td><td>GPS_TX</td><td>3</td><td>GPS_RX</td></tr><tr><td>4</td><td>SCL</td><td>4</td><td>SCL</td></tr><tr><td>5</td><td>SDA</td><td>5</td><td>SDA</td></tr><tr><td>6</td><td>BUTTON</td><td>-</td><td>-</td></tr><tr><td>7</td><td>BUTTON_LED</td><td>-</td><td>-</td></tr><tr><td>8</td><td>GND</td><td>6</td><td>GND</td></tr></tbody></table><h2 id="specification" tabindex="-1">Specification <a class="header-anchor" href="#specification" aria-label="Permalink to &quot;Specification&quot;">​</a></h2><ul><li><strong>Processor:</strong> STM32F302</li><li><strong>Sensor</strong><ul><li><strong>Compass, Gyro, Accelerometer:</strong> ICM20948</li><li><strong>Barometer:</strong> MS5611</li></ul></li><li><strong>Receiver Type:</strong> 72-channel u-blox M8N engine, GPS/QZSS L2 C/A, GLONASS L10F, BeiDou B11, Galileo E1B/C, SBAS L1 C/A: WAAS, EGNOS, MSAS, GAGAN</li><li><strong>Navigation Update Rate:</strong> Max: 10 Hz</li><li><strong>Positionaing Accuracy:</strong> 3D Fix</li><li><strong>Time to first fix:</strong><ul><li><strong>Cold start:</strong> 26s</li><li><strong>Aided start:</strong> 2s</li><li><strong>Reacquisition:</strong> 1s</li></ul></li><li><strong>Sensitivity:</strong><ul><li><strong>Tracking &amp; Navigation:</strong> -167 dBm</li><li><strong>Hot start:</strong> -148 dBm</li><li><strong>Cold start:</strong> -157 dBm</li></ul></li><li><strong>Assisted GNSS</strong><ul><li>AssistNow GNSS Online</li><li>AssistNow GNSS Offline (up to 35 days)</li><li>AssistNow Autonomous (up to 6 days)</li><li>OMA SUPL&amp; 3GPP compliant</li></ul></li><li><strong>Oscillator:</strong> TCXO (NEO-8MN/Q)</li><li><strong>RTC crystal:</strong> Build in</li><li><strong>ROM:</strong> Flash (NEO-8MN)</li><li><strong>Available Antennas:</strong> Active Antenna &amp; Passive Antenna</li><li><strong>Signal Integrity:</strong> Signature feature with SHA 256</li><li><strong>Protocols &amp; Interfaces:</strong><ul><li><strong>UART/I2C/CAN:</strong> JST_GH Main interface, Switch internally.</li><li><strong>STM32 Main Programming Interface:</strong> JST_SUR</li></ul></li></ul>',21)]))}const S=i(s,[["render",l]]);export{m as __pageData,S as default};
